db.contents.findOneAndUpdate({ _id: ObjectId("5de8ea8e2bf37b7aa5e9336b") }, { '$setOnInsert': { createdAt: new Date("Mon, 23 Dec 2019 07:17:29 GMT") }, '$set': { contentType: 'NEWS', title: 'Amnesty reacts as Tanzania withdraws from African court', description: 'International human rights group Amnesty International has raised the red flag over Tanzania’s move to block the right of individuals and NGOs to directly file cases against the country at the African Court on Human and People’s Rights (AfCHPR). The global watchdog reckons the move will deepen repression in the neighbouring country. \n\nTanzania has the highest number of cases filed by individuals and NGOs as well as judgments issued against it by the Arusha-based court. Out of the 70 decisions issued by AfCHPR by September 2019, 28 decisions, or 40 percent, were on Tanzania. \n\nLast week, the African Court ruled that a section of the Tanzanian penal code which provides for mandatory death sentence in capital offences violates the right to fair trial and undermines judicial independence, but also the right to life.Earlier, the Minister for Justice and Constitutional Affairs Dr Augustine Mahiga told The Citizen that action had been taken regarding the decision to withdraw but he said Tanzania was only asking for a review of a protocol it had deemed ‘contentious.\n\n”The move attracted local and international concern, with the Amnesty International’s Africa Advocacy Coordinator Japhet Biegon saying the withdrawal of rights will rob people and organizations in Tanzania a vital avenue to justice. \n\n“This move effectively blocks individuals and NGOs in the country from directly going to the court to seek redress for human rights violations in what is clearly a cynical attempt to evade accountability,” he said. “This is yet more evidence of the government of Tanzania’s growing hostility towards human rights and human rights defenders. It undermines the authority and legitimacy of the African Court and is an outright betrayal of efforts in Africa to establish strong and credible regional human rights bodies that can deliver justice and accountability.”\n\nHe said the move also undermines the authority and legitimacy of the African Court and is an outright betrayal of efforts to establish strong and credible regional human rights bodies that can deliver justice and accountability. \n\nTanzania becomes the second country after Rwanda to withdraw the right of individuals and NGOs to directly access the African Court, a vital continental judicial body in the face of State interference in some justice systems. \n\nThe Citizen', starring: undefined, director: undefined, tags: [ ObjectId("5deb724e16c2ad315f2d02ab") ], isSeries: false, categories: [ ObjectId("5de8a19612f1876c9365ea47") ], subCategories: [ ObjectId("5de8db47cc446376c1110e84") ], country: [ ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d2f8"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d253") ], language: undefined, isFree: true, priceDetail: undefined, createdBy: undefined, releaseDate: undefined, isFreeForAzam: true, boundingBox: undefined, cdnID: undefined, duration: undefined, imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/mahiga_1575445642-637cf262a2927bb90cceae941cde05fa.jpg', packageID: [], vodType: undefined, series: [], images: [], videoURL: undefined, isEpisode: false, referenceChannelID: null, updatedAt: new Date("Mon, 23 Dec 2019 07:17:29 GMT") } }, { new: false, upsert: false, projection: {} })
