db.contents.findOneAndUpdate({ _id: ObjectId("5de8ed762bf37b7aa5e9344a") }, { '$setOnInsert': { createdAt: new Date("Mon, 23 Dec 2019 07:33:05 GMT") }, '$set': { contentType: 'NEWS', title: 'Formal employment in Tanzania on the decline', description: 'The number of Tanzanians in formal employment in government (civil service) and the private sector has been dropping over the past five years, according to a recently-released National Bureau of Statistics (NBS) labour market report. \n\nThe report says new jobs in the private sector hit a low of 137,054 in 2017/18, about a third of the 408,756 jobs created in 2013/14.\n\nEmployment within the civil service also declined sharply from 49,615 in 2013/14 to 18,000 in 2017/18, although government-backed development projects saw an upturn in job creation numbers from 172,245 to 397,009 in the same period.\n\nThe report, titled “Tanzania in Figures 2018” summarises key socio-economic characteristics and selected development indicators for the country from 2013 to 2018. The data is useful for policymakers in planning, monitoring and evaluating development programmes.According to the report, Tanzania’s labour force grew from 22.3 million to 24.3 million between 2014 and 2018. \n\nThe official unemployment rate was estimated to have declined from 10.3 per cent in 2014 to 9.7 per cent in 2018.Official statistics also highlight changes in employment distribution ratios in the economic sector in the past 10 years, with Tanzanians active in the agricultural sector dropping from 73.41 per cent in 2008 to 66.35 per cent by 2018.\n\nThe East African', starring: undefined, director: undefined, tags: [ ObjectId("5deb724e16c2ad315f2d02ab") ], isSeries: false, categories: [ ObjectId("5de8a19612f1876c9365ea47") ], subCategories: [ ObjectId("5de8db47cc446376c1110e84") ], country: [ ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d2f8"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d253") ], language: undefined, isFree: true, priceDetail: undefined, createdBy: undefined, releaseDate: undefined, isFreeForAzam: true, boundingBox: undefined, cdnID: undefined, duration: undefined, imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/office_1575447560-a65dee2ba34151c09bbfd599e35f659b.jpg', packageID: [], vodType: undefined, series: [], images: [], videoURL: undefined, isEpisode: false, referenceChannelID: null, updatedAt: new Date("Mon, 23 Dec 2019 07:33:05 GMT") } }, { new: false, upsert: false, projection: {} })
